# Input sequence
test_sequence = ""

def sequence(string):
    adenine, guanine, cytosine, thyamine  = (0,0,0,0)
    # Make a function here that counts the number of nucleotides in the input 
    # sequence, return as variable "length".
    for i in string:
        if i =="A":
            adenine += 1
        elif i == "G":
            guanine += 1
        elif i == "C":
            cytosine +=1 
        elif i == "T":
            thyamine +=1
        
    return {'Adenine': adenine, 'Guanine':guanine, 'Cytosine':cytosine, 'Thyamine':thyamine}
 
# Print your result.
print(sequence(test_sequence))